ntain'=>'Zawiera','Cover'=>'Okładka','Auto'=>'Automatycznie','Background Size'=>'Rozmiar tła','Usage Data Sharing'=>'Śledzenie danych użytkowania','Connecting to the Library failed. Please try reloading the page and try again'=>'Połączenie z biblioteką nie powiodło się. Ponownie załaduj stronę i spróbuj ponownie','Connected as %s'=>'Połączono jako %s','Enable Lightbox In Editor'=>'Włącz Lightbox w edytorze','Dark'=>'Ciemny','Light'=>'Jasny','Auto Detect'=>'Automatyczne wykrywanie','Set light or dark mode, or use Auto Detect to sync it with your OS setting.'=>'Ustaw tryb jasny lub ciemny lub użyj funkcji "Automatyczne wykrywanie", aby zsynchronizować go z ustawieniami systemu operacyjnego.','UI Theme'=>'Wygląd interfejsu','Preferences'=>'Ustawienia','Don\'t rely solely on the FontAwesome icons everyone else is using! Differentiate your website and your style with custom icons you can upload from your favorite icons source.'=>'Nie polegaj wyłącznie na ikonach FontAwesome, których wszyscy inni używają! Zróżnicuj swoją stronę internetową i styl za pomocą niestandardowych ikon, które możesz przesyłać z ulubionych źródeł ikon.','Add Your Custom Icons'=>'Dodaj własne ikony','Custom Icons'=>'Własne ikonki','Transition'=>'Przejście','Duration'=>'Czas trwania','Clear Log'=>'Wyczyść dziennik','Next'=>'Następne','Previous'=>'Poprzednie','Amount'=>'Kwota','Add Element'=>'Dodaj element','Line'=>'Linia','Basic Gallery'=>'Galeria podstawowa','Out'=>'Na zewnątrz','In'=>'W środku','Ken Burns Effect'=>'Efekt Ken Burns','This cover image will replace the background video in case that the video could not be loaded.'=>'Ten obrazek zastąpi wideo w tle na wypadek, gdyby nie można go załadować.','Play On Mobile'=>'Odtwarzaj na urządzeniach mobilnych','YouTube/Vimeo link, or link to video file (mp4 is recommended).'=>'Odnośnik do YouTube/Vimeo lub odnośnik do pliku wideo (zalecane mp4).','Reinstall'=>'Zainstaluj ponownie','Post'=>'Wpis','File Path: %s'=>'Ścieżka pliku: %s','Need Help'=>'Potr